import React from "react";
import SubTextBox from "./SubTextBox";

const TextBox = () =>{
    return (
        <div className="TextBox">
            <div className="container">
                <div className="row">
                    <SubTextBox />
                    <SubTextBox />
                    <SubTextBox />

                </div>
            </div>
        </div>

    )
}

export default TextBox;
